{
    "$id": "/schemas/anyAxis",
    "description" : "Validates any axis",
    "properties": {
        "dataType": { "enum": ["primitive", "tuple", "polygon"] }
    },
    "allOf": [
        {
            "if": {
                "properties": { "dataType": { "const": "tuple" } },
                "required": ["dataType"]
            },
            "then": { "$ref": "/schemas/tupleAxis" }
        },
        {
            "if": {
                "properties": { "dataType": { "const": "polygon" } },
                "required": ["dataType"]
            },
            "then": { "$ref": "/schemas/polygonAxis" }
        },
        {
            "if": {
                "anyOf": [
                    {
                        "properties": { "dataType": { "const": "primitive" } },
                        "required": ["dataType"]
                    },
                    {
                        "not": { "required": ["dataType"] }
                    }
                ]
            },
            "then": {
                "oneOf": [
                    { "$ref": "/schemas/numericAxis" },
                    { "$ref": "/schemas/stringAxis" }
                ]
            }
        }
    ]
}{
    "$id": "/schemas/numericAxis",
    "description" : "Simple axis with numeric values",
    "allOf" :
    [
        {
            "if": { "required": ["start", "stop", "num"] },
            "then": {
                "description" : "A regularly-spaced numeric axis",
                "properties" :
                {
                    "start" : { "type" : "number" },
                    "stop" : { "type" : "number" },
                    "num" :
                    {
                        "type" : "integer",
                        "minimum" : 1
                    }
                },
                "required" : [ "start", "stop", "num" ],
                "additionalProperties" : false
            }
        },
        {
            "if": { "required": ["values"] },
            "then": {
                "description" : "Axis defined by list of numeric axis values and optional bounds",
                "properties" :
                {
                    "dataType" : { "const" : "primitive" },
                    "values" :
                    {
                        "type" : "array",
                        "items" : { "type" : "number" },
                        "minItems" : 1,
                        "uniqueItems" : true
                    },
                    "bounds" :
                    {
                        "description" : "Optional axis bounds. Must be twice as long (and same data type) as \"values\"",
                        "type" : "array",
                        "items" : { "type" : "number" },
                        "minItems" : 2
                    }
                },
                "required" : [ "values" ],
                "additionalProperties" : false
            }
        },
        {
            "anyOf": [
                { "required": ["start", "stop", "num"] },
                { "required": ["values"] }
            ]
        }
    ]
}
